import './App.css';
import React from 'react';
import { library } from '@fortawesome/fontawesome-svg-core'
import { fas } from '@fortawesome/free-solid-svg-icons'
import { faTwitter, faFontAwesome } from '@fortawesome/free-brands-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

library.add(fas, faTwitter, faFontAwesome)

class Place extends React.Component {
  constructor(props) {
    super(props);
  }


  render() {
    {
      if (this.props.other) {
        return (
          <div id='place' className='border border-primary-1 rounded-5 m-5 p-5'>
            <p>Place</p>
            <form>
              <div class="form-floating mb-3">
                <input type="text" className="form-control" id="floatingInput" placeholder="Username" />
                <label for="floatingInput">Username</label>
              </div>
              <div class="form-floating">
                <input type="password" className="form-control" id="floatingPassword" placeholder="Password" />
                <label for="floatingPassword">Password</label>
              </div>
            </form>
          </div>
        );
      } else {
        return (
          <div>
            <button onClick={this.props.click(2)} type="button" className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fas fa-magnifying-glass" style={{ color: "#613583", }} /></button>
            <p>Places</p>
          </div>
        );
      }
    }
  }
}

class Register extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    {
      if (this.props.other) {
        return (
          <div id='register' className='border border-primary-1 rounded-5 m-5 p-5'>
            <p>Register</p>
            <form>
              <div className="form-floating mb-3">
                <input type="text" className="form-control" id="floatingInput" placeholder="Username" />
                <label for="floatingInput">Username</label>
              </div>
              <div className="form-floating">
                <input type="password" className="form-control" id="floatingPassword" placeholder="Password" />
                <label for="floatingPassword">Password</label>
              </div>
            </form>
          </div>
        );
      } else {
        return (
          <div>
          <button onClick={this.props.click(2)} type="button" className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fa-solid fa-address-card" style={{ color: "#613583", }} /></button>
          <p>Register</p>
        </div>
        );
      }
    }
  }
}

class LogIn extends React.Component {
  constructor(props) {
    super(props);
  }


  render() {
    {
      if (this.props.other) {
        return (
          <div id='login' className='border border-primary-1 rounded-5 m-5 p-5'>
            <p>Log In</p>
            <form>
              <div class="form-floating mb-3">
                <input type="text" className="form-control" id="floatingInput" placeholder="Username" />
                <label for="floatingInput">Username</label>
              </div>
              <div class="form-floating">
                <input type="password" className="form-control" id="floatingPassword" placeholder="Password" />
                <label for="floatingPassword">Password</label>
              </div>
            </form>
          </div>
        );
      } else {
        return (
          <div>
            <button type="button" onClick={this.props.click(1)} className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fas fa-user" style={{ color: "#613583", }} /></button>
            <p>Log In</p>
          </div>
        );
      }
    }
  }
}

class HomePage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      login: true,
      register: false,
      place: false
    }
    this.newClick = this.newClick.bind(this); 
  }

  newClick(btn) {
    switch(btn) {
      case 1: this.setState({login: true,
                      register: false,
                      place: false});
              break; 
      case 2: this.setState({login: false,
                             register: true,
                             place: false});
              break;
      default: this.setState ({login: false,
                               register: false,
                               place: true});
    }
  }

  render() {
    return (
      <div id="homepage" className='conteiner-fluid d-flex flex-column  align-items-center justify-content-center'>
        <LogIn other={this.state.login} click={this.newClick}/>
        <Register  other={this.state.register} click={this.newClick}/>
        <Place other={this.state.place} click={this.newClick}/>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <HomePage />
    </div>
  );
}

export default App;
